import React, { Component } from 'react'
import './App.css'
import WeatherApp from './component/WeatherApp';
import { LoadingSpinnerComponent} from './loadingSpinner';

class App extends Component {
  render() {
    return (
      <div className="container">
        <WeatherApp />
        <LoadingSpinnerComponent />

      </div>
    );
  }
}

export default App;
